const[visible, setvibility] = useState([])

const imageone = false;
const Main = () => {
    return ( 

<div>
   <Tutton/>
  { imageone && <IMGOne/>}
  { !imageone && <IMGtwo/>}
</div>

     );
}
 
export default Main;
